import axios from 'axios'

export interface ICitiesResponse {
  cities: Array<[string, number, number]>
}

const sleep = (ms: number): Promise<ReturnType<typeof setTimeout>> => {
  return new Promise((resolve) => {setTimeout(resolve, ms)})
}

export const fetchCities = async (search: string): Promise<ICitiesResponse> => {
  const response = await axios.get(`http://localhost:8000/api/v1/cities/?q=${search}`).then(await sleep(5000))
  const cities = response.data

  return cities
}
